INSERT INTO `PKG` VALUES (124,'overloadTest','overloadTest_124.drl','','mvel','/drl_files','','admin','2021-11-09 06:31:01','admin','2021-11-23 08:59:27'),(125,'objTest1','ttt_125.drl',_binary 'package objTest1;\nimport java.util.Map;\nimport static egovframework.ktds.targetai.function.DaySinceLastEventT.daysincelasteventt;\n\nrule \"ttt\"\n	no-loop true\n	lock-on-active true\n	salience 2\n	when\n		$map : Map(\n		eval(daysincelasteventt($map.get(\"BPROD_NM\"), 1, 2) == true)	)\n	then\n		$map.put(\"ruleId_558\", 558);\n		$map.put(\"campId_558\", null);\n		$map.put(\"salience_558\", 2);\n		$map.put(\"ruleNm_558\", \"ttt\");\n		$map.put(\"targetType_558\", \"CUST\");\nend\n\n','mvel','/drl_files','ttt','admin','2021-11-23 05:51:54','admin','2021-11-25 01:51:45'),(126,'objTest2','objTest2_126.drl',_binary 'package objTest2;\nimport java.util.Map;\nimport static egovframework.ktds.targetai.function.newTestFunc.newtestfunc;\nimport static egovframework.ktds.targetai.function.DaySinceLastEventT.daysincelasteventt;\n\nrule \"함수 object 테스트 2\"\n	no-loop true\n	lock-on-active true\n	salience 1\n	when\n		$map : Map(\n		eval(newtestfunc($map.get(\"MPHON_COMB_YN\"), $map.get(\"CUST_AGE\")) == true) &&\n		eval(daysincelasteventt($map.get(\"MPHON_COMB_YN\"), 23, $map.get(\"EFCT_INET_SBSC_CASCNT\")) == true)	)\n	then\n		$map.put(\"ruleId_560\", 560);\n		$map.put(\"campId_560\", null);\n		$map.put(\"salience_560\", 1);\n		$map.put(\"ruleNm_560\", \"함수 object 테스트 2\");\n		$map.put(\"targetType_560\", \"CUST\");\nend\n\n','mvel','/drl_files','','admin','2021-11-24 00:29:10','admin','2021-11-24 04:11:02');
